private void popStackToClose(Token.EndTag endTag) {
    String elName = endTag.normalName();
    Element firstFound = null;

    // Find the first occurrence of the element in the stack
    for (int pos = stack.size() - 1; pos >= 0; pos--) {
        Element next = stack.get(pos);
        if (next.nodeName().equals(elName)) {
            firstFound = next;
            break;
        }
    }
    if (firstFound == null) {
        return; // Element not found in the stack, nothing to do
    }

    // Remove elements from the stack until the first occurrence is removed
    List<Element> elementsToRemove = new ArrayList<>();
    for (int pos = stack.size() - 1; pos >= 0; pos--) {
        Element next = stack.get(pos);
        elementsToRemove.add(next);
        stack.remove(pos);
        if (next == firstFound) {
            break;
        }
    }

    // Re-add elements back to the stack in reverse order
    for (int i = elementsToRemove.size() - 1; i >= 0; i--) {
        Element element = elementsToRemove.get(i);
        if (element == firstFound) {
            break;
        }
        stack.add(element);
    }
}

